import { Button } from "@mui/material";
import React from "react";
import { Autocomplete } from "@mui/material";

const Test = () => {
  return (
    <div>
      <Button variant="contained">Hello world</Button>

      <Autocomplete
        disablePortal
        options={top100Films}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="Movie" />}
      />
    </div>
  );
};

export default Test;
